                <p style={{marginTop:"10px",padding:"10px"}}>Modern platforms and apps, ₹0 investments, and flat ₹20 intraday and F&O trades.</p>
                <button type="button" class="btn btn-primary" style={{width:"20%",margin:"auto"}}>Signup Now</button>
            </div>
        </div>
     );
}

